import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <header class="flex flex-wrap bg-emerald-100 h-24 justify-between items-center shadow-md">
            <div class="flex items-center px-8">
              <h2 class="justify-center px-2">CMP</h2>
            </div>
            <nav>
                <a href="register.html" class="px-8 hover:text-indigo-700 text-xl text-white">Crear Cuenta</a>
            </nav>
      </header>


    </div>
  );
}

export default App;
